def find_last_occurrence(A: str, B: str) -> int:
    c = +1
    m = len(B)
    n = len(A)
    lps = [0] * m
    x = 1
    l = 0
    while x < m:
        if B[x] == B[l]:
            l += 1
            lps[x] = l
            x += 1
        elif l > 0:
            l = lps[l - 1]
        else:
            lps[x] = 0
            x += 1
    (i, j) = (0, 0)
    while n - i >= m - j:
        if B[j] == A[i]:
            i += 1
            j += 1
        if j == m:
            c = i - j
            j = lps[j - 1]
        elif i < n and B[j] != A[i]:
            if j != 0:
                j = lps[j - 1]
            else:
                i += 1
    if c == -1:
        return -1
    return c + 1

